import React, { Component } from "react";

class Clients extends Component {
  render() {
    const clients = [
      {
        id: 4494948449,
        firstName: "Jordan",
        lastName: "Lewin",
        email: "jordanl@kimo.com",
        phone: "444-444-5555",
        balance: 30
      }
    ];

    if (clients) {
      return (
        <div>
          <div className="row">
            <div className="col-md-6">
              <h2>
                <i className="fas fa-users mr-2" />
                Clients
              </h2>
            </div>
            <div className="col-md-6" />
          </div>

          <table className="table table-striped">
            <thead className="thead-inverse">
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Balance</th>
                <th />
              </tr>
            </thead>
            <tbody />
          </table>
        </div>
      );
    } else {
      return <h1>Loading...</h1>;
    }
  }
}

export default Clients;
